                                </v-card-title>

                                <v-card-text>
                                    <p class=""text-center"">
                                        CONTRATO ADHESION INVERSIONISTA
                                    </p>

                                    <p class=""text-center""> <u>DEFINICIONES</u> </p>

                                    <p class=""text-justify"">
                                        Para todos los efectos y consecuencias derivadas de la aplicación y alcance de este contrato y con el fin de lograr una correcta y exacta interpretación de este documento las siguientes palabras, utilizadas en singular o plural, mayúsculas o minúsculas, resaltadas o no, femenino o masculino, y salvo que el contexto lo requiera de otra forma, las palabras o expresiones definidas en singular incluirán su forma plural y viceversa, teniendo todas ellas el único y exclusivo significado que se indica a");
            WriteLiteral(@" continuación:
                                    </p>
                                    <p class=""text-justify"">
                                        EL BANCO: Corresponde a la persona jurídica confirmante de la operación, la cual garantiza el pago a EL INVERSIONISTA ganador de la operación de confirming (pago a proveedores), una vez que llegue(n) al vencimiento la(s) factura(s) por la que haya ofertado.
                                    </p>
                                    <p class=""text-justify"">
                                        EMPRESA: Corresponde a la sociedad mercantil <b>TUFACTORING SERVICIOS C.A.</b> domiciliada en la ciudad de Caracas, Distrito Capital, constituida por documento inscrito por ante el Registro Mercantil xx de la Circunscripción Judicial del Distrito Capital y Estado Miranda, en fecha xxxxx de xxxxxx de xxxxx, bajo el N.° xx, Tomo xxxxxx.
                                    </p>
                                    <p class=""text-justify"">
                   ");
            WriteLiteral(@"                     SISTEMA TUFACTORING (ó Sistema): Corresponde a un Desarrollo Tecnológico que permite a EL CLIENTE, a través del uso de los canales de banca por internet, realizar operaciones de registro, venta, compra, ordenar el pago o ceder Facturas de sus proveedores, así como intercambiar información exclusivamente relacionada con dichas Facturas.
                                    </p>
                                    <p class=""text-justify"">
                                        INVERSIONISTA. Es la persona natural o jurídica que se convierte en acreedora de El CLIENTE como consecuencia de transacciones de compra de Facturas expedidas por EL PROVEEDOR originario, y a favor de quien este último acepta su cesión una vez que acepta el descuento ofertado por el Valor Neto de la factura subastada.
                                    </p>
                                    <p class=""text-justify"">
                                        EL CLIENTE: Es la persona natural o jurídica titular de");
            WriteLiteral(@" una cuenta o de cualquier otro servicio o producto ofrecido por EL BANCO quien, luego de cumplir las formalidades propias de afiliación al sistema de Banca Electrónica o Banca por Internet, particularmente al Sistema TuFactoring, conforme al procedimiento señalado a tal efecto por EL BANCO, quien, siendo aceptante o deudor de una o varias facturas, registre dichos instrumentos en el Sistema de manera que pudieran ser objeto de subasta para el pago anticipado de las mismas a sus proveedores.
                                    </p>
                                    <p class=""text-justify"">
                                        PROVEEDOR. Es la persona natural o jurídica acreedora de EL CLIENTE como consecuencia de transacciones comerciales consistentes en la venta o suministro de bienes y/o servicios, por lo cual ha expedido una Factura cuyo pago está a cargo de EL CLIENTE.
                                    </p>
                                    <p class=""text-justify"">
                         ");
            WriteLiteral(@"               DESCUENTO: A los únicos efectos de este contrato, corresponde a la cantidad resultante de aplicar la siguiente fórmula, al momento de efectuar las operaciones de venta de factura a través del Sistema:
                                    </p>
                                    <p class=""text-justify"">
                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(VNXTD)<br />
                                        D=_________ND<br />
                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(360)

                                    </p>
                                    <p class=""text-justify"">
                                        Donde ""D"" significa Descuento, ""VN"" significa Valor Neto, ""TD"" significa Tasa de Descuento; ""ND"" significa el número de días que resulte de sumar los días naturales desde e inclusive la fecha en que se entregue al Proveedor el Precio de venta, respecto de un Derecho Adquirido, hasta inclusive la fecha de vencimiento de d");
            WriteLiteral(@"icho derecho de Crédito.
                                    </p>
                                    <p class=""text-justify"">
                                        TASA DE DESCUENTO: Corresponde a la tasa aceptada por EL PROVEEDOR para determinar el Descuento que se va a aplicar al Valor Neto de la factura subastada, entre las distintas ofertas realizadas por los distintos inversionistas participantes durante horario en que se encuentre activo el Mercado Electrónico. El cálculo del Descuento se realizará desde la fecha en que se efectúe el anticipo de fondos, hasta la fecha del vencimiento de la Factura.
                                    </p>
                                    <p class=""text-justify"">
                                        FACTURA: Corresponde al documento o título de carácter mercantil contentivo de una obligación de pago con ocasión de la adquisición de bienes o servicios por parte de EL CLIENTE.
                                    </p>
                                    <p ");
            WriteLiteral(@"class=""text-justify"">
                                        VALOR NETO. Se refiere al monto resultante de restar al valor numérico expresado en el texto de la Factura todos los tributos o retenciones a los que hubiere lugar, incluso las notas de crédito, si existiesen. Debe ser cargado por EL CLIENTE en el Sistema. En el caso del pago al vencimiento, EL BANCO podrá proceder a pagar dicho valor a EL PROVEEDOR o a EL INVERSIONISTA y, en caso de haberla comprado EL BANCO, retirar el monto correspondiente de la(s) cuenta(s) de EL CLIENTE o imputarlo a la línea de crédito correspondiente, de ser el caso.
                                    </p>
                                    <p class=""text-justify"">
                                        PRECIO DE VENTA: Corresponde al resultado de haber deducido del valor neto de las facturas, antes explicado, la tasa de descuento ofertada por EL INVERSIONISTA ganador en la respectiva operación, y la cual fue aceptada por EL PROVEEDOR.
                               ");
            WriteLiteral(@"     </p>
                                    <p class=""text-justify"">
                                        CLAVES DE ACCESO: Corresponde a un mecanismo de Seguridad de la Información Electrónica, constante de factores de autenticación tendentes a verificar la identidad de EL CLIENTE y de EL BANCO y la cualidad de éstos para realizar las operaciones propias del SISTEMA TUFACTORING. Estos factores de autenticación corresponderán a aquellos establecidos como Factor de autenticación categorías 2 y 3 de acuerdo a la Resolución Nº 641.10 emanada de la Superintendencia de las Instituciones del Sector Bancario (SUDEBAN) contentiva de las “Normas que Regulan el Uso de los Servicios de la Banca Electrónica”, publicada en la Gaceta Oficial de la República Bolivariana de Venezuela Nº 39.597 de fecha 19 de enero de 2011.
                                    </p>
                                    <p class=""text-justify"">
                                        DÍAS HÁBILES BANCARIOS: Corresponde a los días compre");
            WriteLiteral(@"ndidos entre lunes y viernes que, conforme al calendario bancario, sean laborables para los bancos.
                                    </p>
                                    <p class=""text-justify"">
                                        DERECHO DE CRÉDITO: corresponde al derecho que tiene el acreedor de una deuda QUE EL CLIENTE tiene obligación de pagar conforme a la Factura.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA PRIMERA:</b></u> Mediante el registro en el Sistema Tufactoring y la aceptación del presente contrato de adhesión, EL INVERSIONISTA manifiesta su interés en participar en subastas para la compra de Facturas registradas previamente en el Sistema Tufactoring, en el marco de una operación de confirming (pago a proveedores). En virtud de ello, EL INVERSIONISTA acepta expresamente las particularidades y condiciones expresadas en este instrumento.
                              ");
            WriteLiteral(@"      </p>
                                    <p class=""text-justify"">
                                        La operación en la que participaría EL INVERSIONISTA consiste en que EL PROVEEDOR (a quien EL INVERSIONISTA podrá o no conocer)  una vez que haya aceptado la mejor oferta que arroje el Sistema Tufactoring con base en los descuentos propuestos por los distintos inversionistas, transmitirá a favor de EL INVERSIONISTA ganador todos los derechos de crédito inherentes a la factura y EL BANCO garantizará a este último el pago de la factura a su vencimiento por el valor neto que presenta el Sistema.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b> CLÁUSULA SEGUNDA:</b></u> EL INVERSIONISTA una vez registrado en el sistema, podrá participar en el mismo ofertando por la compra de facturas registradas por los clientes de EL BANCO  y autorizadas para su venta por los proveedores respectivos, dentro de los p");
            WriteLiteral(@"arámetros que el propio Sistema Tufactoring fija.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA TERCERA:</b></u> EL INVERSIONISTA en caso de no tener operativa una Cuenta en EL BANCO en el cual se depositen todos los importes correspondientes a los fondos provenientes de la liquidación de la operación de venta de Facturas, entiende y acepta que el pago del Precio de venta deberá realizarse en la cuenta de LA EMPRESA destinada para tal fin en EL BANCO.
                                    </p>
                                    <p class=""text-justify"">
                                        EL INVERSIONISTA asume las tarifas bancarias establecidas por el Banco Central de Venezuela por concepto de transferencia de fondos al momento en que se realice el pago así como impuestos actuales y futuros por concepto de débitos bancarios. En cualquier caso, de hacerse el pago a través de una transferencia");
            WriteLiteral(@" por no disponer EL INVERSIONISTA de cuenta en EL BANCO, el Sistema Tufactoring y, por tanto, LA EMPRESA ni EL BANCO serán responsables de cualquier mal funcionamiento del sistema de transferencias bancarias.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA CUARTA:</b></u> EL INVERSIONISTA está en pleno conocimiento que compite en una puja en la que participan otros inversionistas, siendo informado por el sistema en el momento en que su oferta ha sido aceptada por EL PROVEEDOR. En consecuencia, EL INVERSIONISTA acepta que no obstante realice la mejor oferta, EL PROVEEDOR pudiera rechazarla sin que ello motive compensación ni indemnización alguna
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA QUINTA:</b></u> El Precio de venta que pagará EL INVERSIONISTA ganador, será el que se obtenga en e");
            WriteLiteral(@"l Sistema TuFactoring, aplicando al Valor Neto de la factura la tasa de descuento ofertada EL INVERSIONISTA ganador y aceptada por EL PROVEEDOR.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA SEXTA:</b></u> EL INVERSIONISTA está en conocimiento que EL PROVEEDOR tendrá hasta sesenta (60) minutos después del cierre de la jornada para aceptar la venta, en caso contrario se tendrá como rechazada la oferta. En este punto, se indica que el horario del sistema es el siguiente: Para operaciones de consulta las 24 horas del día y los 365 días del año; para afiliación en el sistema  o registro de facturas, en los días hábiles bancarios en horario comprendido de 8:00 a.m. a 3:00 p.m.; y para la oferta de facturas, en horario comprendido de 8:00 a.m. a 12:00 p.m.; siempre y cuando no existan fallos o suspensiones del servicio electrónico, eléctrico o cualquier otra causa de fuerza mayor que imposibilite su emp");
            WriteLiteral(@"leo.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA SÉPTIMA:</b></u> EL INVERSIONISTA acepta que bastará sólo con la comunicación que por el Sistema Tufactoring reciba respecto a que su oferta fue aceptada para realizar el pago en un plazo máximo de sesenta (60) minutos. Una vez transcurrido dicho lapso sin que se haya verificado el pago, la operación queda anulada y EL INVERSIONISTA será bloqueado en El Sistema, debiendo asumir los gastos administrativos inherentes a la operación.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA OCTAVA:</b></u> EL BANCO podrá verificar en todo momento a las personas naturales o jurídicas que se registren como inversionistas en el Sistema Tufactoring, reservándose el derecho de rechazar su inclusión en el sistema sin necesidad de declaración o resolución j");
            WriteLiteral(@"udicial, en caso de que EL INVERSIONISTA sea objeto de medidas o de investigación por parte de algún organismo o institución, nacional o internacional, encargado de la Prevención de legitimación de capitales o lavado de activos o por cualquier causa que razonablemente pudiera comprometer la seguridad de los clientes de EL BANCO.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA NOVENA:</b></u> EL INVERSIONISTA conoce que EL PROVEEDOR declaró la existencia y legitimidad de los Derechos de Crédito Adquiridos y reflejados en la(s) factura(s) por él autorizadas, de conformidad con el artículo 124 del Código de Comercio.
                                    </p>
                                    <p class=""text-justify"">
                                        La información e instrucciones suministradas a través del Sistema Tufactoring, tendrán pleno valor probatorio y fuerza legal para acreditar la op");
            WriteLiteral(@"eración realizada, el importe de la misma, su naturaleza, así como las características y alcance de sus instrucciones. EL INVERSIONISTA conoce que el uso de los medios de identificación previstos en el contrato para realizar operaciones a través del Sistema, podrá equivaler a la firma autógrafa y producir los mismos efectos que las leyes otorgan a los documentos correspondientes.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA DÉCIMA: </b></u> La aceptación de la oferta hecha por EL INVERSIONISTA por parte de EL PROVEEDOR y la concreción del pago dentro del plazo estipulado y en las condiciones determinadas en el presente instrumento, determinan la transmisión a EL INVERSIONISTA de todos los Derechos de Crédito sin reserva ni limitación alguna. EL INVERSIONISTA recibirá del propio sistema el contrato de la cesión a su favor hecha por EL PROVEEDOR.
                                    </p>
         ");
            WriteLiteral(@"                           <p class=""text-justify"">
                                        <u><b>CLÁUSULA DÉCIMA PRIMERA: </b></u> Para los efectos del presente Contrato, EL INVERSIONISTA señala como su domicilio el  indicado en el registro electrónico del Sistema Tufactoring; hasta tanto las partes intervinientes en la operación no se notifiquen por escrito los cambios de domicilio, todas las comunicaciones que se practiquen en los domicilios antes citados, surtirán plenamente sus  efectos.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLÁUSULA DÉCIMA SEGUNDA: </b></u> Para todos los efectos del presente contrato, sus derivados y consecuencias, se elige como domicilio especial aquel de la suscripción, aceptación o adhesión.
                                    </p>
                                </v-card-text>
                                <v-card-actions>
                                    <v-sp");
